import React from "react";
import Table from 'react-bootstrap/Table'
import Button from 'react-bootstrap/Button';

function BestDeals({
   flights,
}) {
    return (
      flights.map(({
        dateFrom, dateTo, startTime, endTime, fromCountry, toCountry, price,
      }) => (
          <Table responsive>
        <thead>
            <tr>
            <th>Date From</th>
            <th>Date To</th>
            <th>Start time</th>
            <th>End time</th>
            <th>From Country</th>
            <th>To Country</th>
            <th>Price</th>
            <th>Book right now ⤋</th>
            </tr>
        </thead>
        <tbody>
            <tr>
            <td>{dateFrom}</td>
            <td>{dateTo}</td>
            <td>{startTime}</td>
            <td>{endTime}</td>
            <td>{fromCountry}</td>
            <td>{toCountry}</td>
            <td>{price}</td>
            <td><Button className="card-buttons">BOOK NOW</Button></td>
            </tr>
            
        </tbody>
        </Table>
      )
      ));
}

export default BestDeals;

